import axios from "axios";
import "../App.css";

const sendGetRequest = async () => {
  axios.get(`/users/`).then((response) => {
    console.log(response.data);
  });
};

const sendLoginRequest = async () => {
  axios
    .post(`/users/login`, {
      email: email,
      firstName: firstName,
      lastName: lastName,
    })
    .then((response) => {
      console.log(response.data);
    });
};

